import { createMuiTheme } from '@material-ui/core'

const myTheme = createMuiTheme({
    palette: {
        primary: {
            main: "#0d064a"
        }
    },
    typography: {
        fontFamily: 'Noto+Sans+JP',
        fontWeightThin: 100,
        fontWeightLight: 300,
        fontWeightRegular: 400,
        fontWeightMedium: 500,
        fontWeightHeavy: 700,
    }
})

export default myTheme;
